INSERT INTO `wp_posts` VALUES (1,2,'2017-08-03 13:36:29','2017-08-03 13:36:29','<div class=\"padded green\">\r\n\r\nWelcome to <span class=\"red\">WordPress</span>. This is your first post. Edit or delete it, then start writing!\r\n<p class=\"blue\">Blue paragraph.</p>\r\n\r\n</div>\r\n[hoops name=\"post-test\"]\r\n\r\n[hoops name=\"page-test\"]\r\n\r\n[hoops name=\"test-01\"]\r\n\r\n[hoops name=\"test-02\"]\r\n\r\n[hoops name=\"test-03\"]','Hello world!','','publish','open','open','','hello-world','','','2017-08-05 17:23:33','2017-08-05 21:23:33','',0,'http://localhost/?p=1',0,'post','',1),(2,2,'2017-08-03 13:36:29','2017-08-03 13:36:29','This is an <span class=\"red\">example</span> page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</blockquote>\r\n<p class=\"blue\">...or something like this:</p>\r\n\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\n<div class=\"padded green\">\r\n\r\nAs a new WordPress user, you should go to <a href=\"http://localhost/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!\r\n\r\n</div>\r\n&nbsp;\r\n\r\n[hoops name=\"post-test\"]\r\n\r\n[hoops name=\"page-test\"]\r\n\r\n[hoops name=\"test-01\"]\r\n\r\n[hoops name=\"test-02\"]\r\n\r\n[hoops name=\"test-03\"]','Sample Page','','publish','closed','open','','sample-page','','','2017-08-05 17:28:31','2017-08-05 21:28:31','',